//*****************************
//KEYBOARD INPUT SECTION
//*****************************

function keyDown(code, char) {

if (code == 32)
	debugOut("x: " + xInc + "  y: " + yInc);
if (code == 87) {
	keyPressUp = true;
	keyPressDown = false;
} else if (code == 83) {
	keyPressDown = true;
	keyPressUp = false;
}
if (code == 65) {
	keyPressLeft = true;
	keyPressRight = false;
} else if (code == 68) {
	keyPressLeft = false;
	keyPressRight = true;
}
if (code == 77)
	keyPressMenu = true;

if (code == 79)
	keyPressO = true;

if (code == 80)
	keyPressP = true;
} 

function keyUp(code, char) {

	if (code == 87) {
		keyPressUp = false;
		collisionY = false;
	} else if (code == 83){
		keyPressDown = false;
		collisionY = false;}
	if (code == 65) {
		keyPressLeft = false;
		collisionX = false;
	} else if (code == 68){
		keyPressRight = false; 
		collisionX = false;}
	if (code == 77)
		keyPressMenu= false;
	if (code == 90)
		keyPressZ = true;
	if (code == 88)
		keyPressX = true;
	if (code == 67)
		keyPressC = true;
	if (code == 49){
		keyPressOne = true;
	}
	if (code == 50){
		keyPressTwo = true;
	}
	if (code == 51){
		keyPressThree = true;
	}
	if (code == 52){
		keyPressFour = true;
	}
	if (code == 53){
		keyPressFive = true;
	}
	if (code == 54){
		keyPressSix = true;
	}
	if (code == 79)
		keyPressO = false;
	
	if (code == 80)
		keyPressP = false;
}

//****************************
//COLLISION CHECKING FUNCTIONS
//****************************

function checkCollision () {
	if (yInc == -7 && keyPressDown)	 {
		collisionY = true;
		yInc = 10;
	} else if (yInc == 7 && keyPressUp) {
		collisionY = true;			
		yInc = -10;
	}
	if (xInc == 7 && keyPressLeft) {
		collisionX = true;
		xInc = -10;
	} else if (xInc == -7 && keyPressRight) {
		collisionX = true;	
		xInc = 10;
	}
}
